import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonItem, IonButton } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab1.css';
import axios from 'axios';

const API_KEY = 'YOUR_API_KEY';
const URL = 'http://paintballinventory-env.eba-yah5svs5.us-east-2.elasticbeanstalk.com/api/guns';

const fetchGuns = () => {

  return axios({
    url: URL,
    method: 'get'
  }).then(response => {

    console.log(response);
    return response.data;
  })
};

const Tab1: React.FC = () => {
  const [guns, setGuns] = React.useState([]);
  const items: any[] = [];

  React.useEffect(() => {

    fetchGuns().then(data => setGuns(data.guns));

  }, []);
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Tab 1</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Tab 1</IonTitle>
          </IonToolbar>
        </IonHeader>
        {
            guns.map(a => {

              return (
                <IonItem>
                  {a['name']}
                  <IonButton href={a['image']} color="primary" slot="end">{a['image']}</IonButton>
                </IonItem>
              );
            })
          }
      </IonContent>
    </IonPage>
  );
};

export default Tab1;
